Category	Feature, Parody / Spoof

Director	Lee Roy Myers
Starring	Dana DeArmond, James Deen, Anthony Rosano, Tanya Tate, Anikka Albrite, April O'Neil, Bailey Blue, Tommy Pistol, Aaron Wilcox, Aaliyah Love, Claire Robbins

Winter Is Cumming!
In a fantasy world where there are kingdoms, and undead ice monsters, and dragons, and a whole lot of humping, everyone is playing the game to win a seat on the Iron Bone! And when the Game of Bones is played, you are always one move away from getting screwed. In Wood Rocket hit movie, 'Game of Bones: Winter is Cumming', the parody of the hit television &amp; book series, all of your favorite characters get spoofed and get really filthy!

